import React, { useState } from 'react';
import axiosInstance from '../../api/axiosInstance';
import useAuth from '../../auth/useAuth';

const LogbookExplosiveDetectorInput = () => {
  const { auth } = useAuth();
  const [formData, setFormData] = useState({
    tanggal: '',
    jam: '',
    flight_penumpang: '',
    nama_penumpang: '',
    operator_etd: '',
    ttd: '',
    keterangan: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    try {
      const response = await axiosInstance.post('/logbook-explosive-detector', { ...formData, user_id: auth.user.user_id });
      setSuccess('Form submitted successfully!');
      setFormData({
        tanggal: '',
        jam: '',
        flight_penumpang: '',
        nama_penumpang: '',
        operator_etd: '',
        ttd: '',
        keterangan: '',
      });
    } catch (err) {
      setError(err.response?.data?.message || 'An error occurred');
    }
  };

  return (
    <form onSubmit={handleSubmit} className="max-w-md mx-auto p-4 bg-white rounded shadow space-y-4">
      <div>
        <label className="block font-medium mb-1">Tanggal</label>
        <input type="date" name="tanggal" value={formData.tanggal} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Jam</label>
        <input type="time" name="jam" value={formData.jam} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Flight Penumpang</label>
        <input type="text" name="flight_penumpang" value={formData.flight_penumpang} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Nama Penumpang</label>
        <input type="text" name="nama_penumpang" value={formData.nama_penumpang} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Operator ETD</label>
        <input type="text" name="operator_etd" value={formData.operator_etd} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">TTD (base64)</label>
        <textarea name="ttd" value={formData.ttd} onChange={handleChange} className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Keterangan</label>
        <textarea name="keterangan" value={formData.keterangan} onChange={handleChange} className="border px-3 py-2 rounded w-full" />
      </div>
      <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded">Submit</button>
      {error && <p className="text-red-500 text-sm">{error}</p>}
      {success && <p className="text-green-600 text-sm">{success}</p>}
    </form>
  );
};

export default LogbookExplosiveDetectorInput;
